ブロック ''{0}'' は、そのデータ型としてバス オブジェクト ''{1}'' を、また、このブロックのパラメーター ''{2}'' に対して、異なるシグネチャをもつ MATLAB 構造体を指定しています。バス オブジェクトと構造体パラメーター間の不整合は次のとおりです。 
(1) バスに存在して、パラメーターからは欠落している要素: 
 {3}
(2) パラメーターに存在して、バスからは欠落しているフィールド: 
 {4}
(3) 順序または位置が違っているフィールドおよび要素: 
 {5}

MATLAB 構造体のフィールドの名前、階層、属性は、バス オブジェクトの要素の名前、階層、信号属性と正確に一致する必要があります。バス オブジェクトから MATLAB 構造体を作成するには、''Simulink.Bus.createMATLABStruct'' を使用します。MATLAB 構造体からバス オブジェクトを作成するには、''Simulink.Bus.createObject'' を使用します。

Parameter Writer ブロック ''{0}'' の指定されたバス型 ''{1}'' の入力信号は、Model ブロック ''{2}'' のデータ型 ''{3}'' の引数 ''{4}'' とすべてのフィールドの名前、階層および/または属性が一致していません。 

バス オブジェクトとモデル引数のデータ型間の不整合は次のとおりです。 
(1) 入力バスに存在して、モデルの引数データからは欠落している要素: 
{5}
(2) モデルの引数データに存在して、入力バスからは欠落している要素: 
{6}
(3) 順序または位置が違っている要素: 
{7}

Parameter Writer ブロック ''{0}'' の指定されたバス型 ''{1}'' の入力信号は、現在のモデル/マスク ワークスペース内の MATLAB 構造体型をもつパラメーター ''{2}'' とすべてのフィールドの名前、階層および/または属性が一致していません。 

バス オブジェクトと構造体パラメーター間の不整合は次のとおりです。 
(1) バスに存在して、パラメーターからは欠落している要素: 
{3}
(2) パラメーターに存在して、バスからは欠落しているフィールド: 
